javascript:
frappe.ready(() => {
    // your script here
    frappe.call({
       method:"lms_api.lms_api.doctype.web_page.web_page.get_help_pdf",
       callback:function(r){
           console.log(r.message);
           if (r.message !== undefined) {
               $('#helppdf').attr('src', r.message);
           } else {
               $('#helppdf').attr('src', 'https://welaph.s3-ap-southeast-1.amazonaws.com/help.pdf');
           }
       }
    });
});
